import React, { useState } from "react";
import { toast } from "react-toastify";
// import axios from "axios";
const Register = () => {

    const [ id,       idchange]     =   useState("");
    const [ name,     namechange]   =   useState("");
    const [ email,    emailchange]  =   useState("");
    const [ password, passwordchange] = useState("");
    const [ phone,    phonechange]    = useState("");
    const [ country,  countrychange]  = useState("");
    const [ address,  addresschange]  = useState("");


    const handlesubmit=(e)=>{
        e.preventDefault();
        let regobj={id,name,password,email,phone,country,address};
        console.log(regobj);
    
          fetch("http://localhost:3000/user",{
               method:"POST",
               headers:{'Content-Type': 'application/json'},
               body: JSON.stringify(regobj)
          }).then((res)=>{
            toast.success('Registered successfully.') 
          }).catch((err)=>{
            toast.error('Failed :'+err.message); 
          });
    } 

    // const [, setData] = useState([]);

    // // useEffect(() => {
    // //     axios.post("http://localhost:3000/user").then((resp)=>{
    // //           console.log(resp.data);
    // //           setData(resp.data);
    // //        }).catch(error=>console.log(error.message))
    // //    },[]);
      



    return (
        <div>
            <div className="offset-lg-3 col-lg-6">
                <form className="container" onSubmit={handlesubmit}>
                    <div className="card">
                        <div className="card-header">
                        <h1> Registeration </h1>
                        </div>
                       <div className="card-body">
                          
                          <div className="row">
                            <div className="col-lg-6">
                                <div className="form-group">
                                 <label>User Name <span className="errmsg">*</span></label>
                                 <input  onChange={e=>idchange(e.target.value)} className="form-control"></input>   
                                </div>
                             </div>
        
                        
                            <div className="col-lg-6">
                                <div className="form-group">
                                 <label> Full Name <span className="errmsg">*</span></label>
                                 <input   onChange={e=>namechange(e.target.value) }className="form-control"></input>   
                                </div>
                             </div>

                            
                            <div className="col-lg-6">
                                <div className="form-group">
                                 <label>Email <span className="errmsg">*</span></label>
                                 <input onChange={e=>emailchange(e.target.value)} className="form-control"></input>   
                                </div>
                             </div>


                             <div className="col-lg-6">
                                <div className="form-group">
                                 <label> Password <span className="errmsg">*</span></label>
                                 <input   onChange={e=>passwordchange(e.target.value)} type="password"  className="form-control"></input>   
                                </div>
                             </div>
                         
                          

                            <div className="col-lg-6">
                                <div className="form-group">
                                 <label>Phone No <span className="errmsg">*</span></label>
                                 <input  onChange={e=>phonechange(e.target.value)} className="form-control"></input>   
                                </div>
                             </div>


                             <div className="col-lg-6">
                                <div className="form-group">
                                 <label> Country <span className="errmsg">*</span></label>
                                 <select onChange={e=>countrychange(e.target.value)} className="form-control">
                                    <option value="india">India</option>
                                    <option value="india">USA</option>
                                    <option value="india">Singapore</option>
                                    <option value="india">L A</option>
                                    </select>   
                                </div>
                             </div>
 
                             
                            <div className="col-lg-12">
                                <div className="form-group">
                                 <label>Address </label>
                                 <textarea  onChange={e=>addresschange(e.target.value)} className="form-control"></textarea>   
                                </div>
                             </div>


                          </div>
                        </div>

                        <div className="card-footer">
                        <button type="submit" className=" btn btn-outline-dark ms-2"> Register </button>     
                        </div> 
                    </div>
                </form>

            </div>
            
        </div>
    );
}

export default Register;
